FeedPackage.Description:
Provides matrix data structure suitable for storing elements in an n-dimensional cartesian coordinate system of positive integers.

example:

            Axis x = new Axis("x", 0, 100, 1);
            Axis y = new Axis("y", 0, 10, 1);

            Matrix<long> matrix = new Matrix<long>(new []{x,y});
            int i = 0;
            for (; i < matrix.Axes[0].Points.Length; i++)
            {
                matrix.Axes[0].Points[i].Label = "x" + i.ToString();
            }
            i = 0;
            for (; i < matrix.Axes[1].Points.Length; i++)
            {
                matrix.Axes[1].Points[i].Label = "y"+ i.ToString();
            }

            foreach (long[] c in matrix)
            {
                matrix[c] = c[0] + c[1];
            }

            foreach (long[] c in matrix)
            {
                Console.WriteLine("{0},{1} ({2},{3}) = {4}", matrix.Axes[0].Points[c[0]].Label, matrix.Axes[1].Points[c[1]].Label, c[0], c[1], matrix[c]);
            }

Parse and coalesce text by applying simple rules in the form of a lambda expression that define word boundaries. Each word is tokenized into a memento that retains all the information about that word within the original context.

example: parsing a double quote qualified csv file.

DialectSoftware.Semantics.WordReader reader = WordReader.Open([path to file]);
            bool include = true;
            var lines = reader.ReadToEnd(c => c == '\n').Select(r => r.ReadToEnd(c =>
            {
                if (c == '\"')
                    include = !include;
                if (c == ',')
                    return include;
                return false;
            }).ToArray()).ToArray();

Parse and coalesce text by applying simple rules in the form of a lambda expression that define word boundaries. Each word is tokenized into a memento that retains all the information about that word within the original context.

example: parsing a double quote qualified csv file.

DialectSoftware.Semantics.WordReader reader = WordReader.Open([path to file]);
            bool include = true;
            var lines = reader.ReadToEnd(c => c == '\n').Select(r => r.ReadToEnd(c => c == ',').Select(w => w.Coalesce((ref char c, string s, out bool b) =>
            {
                b = c != '\"' && c != '\r';
                return true;
            })).ToArray()).ToArray();

GET and parse HTML streams over HTTP or HTTPS, resilient to non-well-formed document structures. Query and enumerate DOM structures with IE's object model.

example:

var d = new DialectSoftware.Web.HTMLDOMDocument(new Uri("http://www.yahoo.com")) as IHTMLDocument2;
Console.WriteLine(d.body.innerText);

